public static boolean isNumber(String s) {
    if (s == null || s.length() == 0)
        return false;
    if (!Character.isDigit(s.charAt(0)) && s.charAt(0) != '-')
        return false;
    int decimal = 0;
    for (int i = 1; i < s.length(); i++) {
        char c = s.charAt(i);
        if (Character.isDigit(c))
            continue;
        if (c == '.') {
            if (decimal == 1)
                return false;
            decimal++;
            continue;
        }
        return false;
    }
    return true;
},"@Test public void testIsNumber() throws Exception { assertTrue(Strings.isNumber(""""))

